import { useEffect, useState } from "react";
import { getPosts } from "../services/posts";

const Posts = () => {
  const [posts, setPosts] = useState([]);
  useEffect(() => {
    getList().then(posts => {
      setPosts(posts);
    }, []);
  });
  return <div>{posts}</div>;
};

export default Posts;
